import React, { useState } from 'react';
import Context from './Context';

function Provider({ children }) {
  const [Post, setPost] = useState([]);
  const dataPost = {
    Post,
    setPost,
  };
  return <Context.Provider value={dataPost}>{children}</Context.Provider>;
}

export default Provider;
